def plot_ESl_ET_vs_ro():
  def profile(ro, scherid, X, ulim=50):
    l = ro_scherid_X_l_m[ro][scherid][X]
    m, s = np.mean(l), np.std(l)
    if m > ulim:
      m, s = float('NaN'), float('NaN')
    return m, s
  
  RLScher_ESl_l, Schera0_ESl_l, Schera3_ESl_l = [], [], []
  RLScher_ESl_err_l, Schera0_ESl_err_l, Schera3_ESl_err_l = [], [], []
  # RLScher_StdSl_l, Schera0_StdSl_l, Schera3_StdSl_l = [], [], []
  RLScher_ET_l, Schera0_ET_l, Schera3_ET_l = [], [], []
  RLScher_ET_err_l, Schera0_ET_err_l, Schera3_ET_err_l = [], [], []
  for ro in ro_l:
    mean, stdev = profile(ro, 'RLScher', 'ESl_l')
    RLScher_ESl_l.append(mean)
    RLScher_ESl_err_l.append(stdev)
    mean, stdev = profile(ro, 'Scher_a=0', 'ESl_l')
    Schera0_ESl_l.append(mean)
    Schera0_ESl_err_l.append(stdev)
    mean, stdev = profile(ro, 'Scher_a=3', 'ESl_l')
    Schera3_ESl_l.append(mean)
    Schera3_ESl_err_l.append(stdev)
    
    mean, stdev = profile(ro, 'RLScher', 'ET_l')
    RLScher_ET_l.append(mean)
    RLScher_ET_err_l.append(stdev)
    mean, stdev = profile(ro, 'Scher_a=0', 'ET_l')
    Schera0_ET_l.append(mean)
    Schera0_ET_err_l.append(stdev)
    mean, stdev = profile(ro, 'Scher_a=3', 'ET_l', ulim=100)
    Schera3_ET_l.append(mean)
    Schera3_ET_err_l.append(stdev)
  
  ## ESl
  plot.errorbar(ro_l, RLScher_ESl_l, yerr=RLScher_ESl_err_l, label='RL', c=NICE_ORANGE, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  plot.errorbar(ro_l, Schera0_ESl_l, yerr=Schera0_ESl_err_l, label='None', c=NICE_BLUE, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  plot.errorbar(ro_l, Schera3_ESl_l, yerr=Schera3_ESl_err_l, label='All', c=NICE_RED, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  
  fontsize = 18
  prettify(plot.gca() )
  plot.legend(framealpha=0.5, loc='best', numpoints=1)
  plot.xticks(rotation=70)
  # plot.yscale('log')
  plot.xlabel(r'Offered load $\rho$', fontsize=fontsize)
  plot.ylabel('Average job slowdown', fontsize=fontsize)
  # plot.title(r'$\rho= {}$'.format(ro), fontsize=fontsize)
  plot.gcf().set_size_inches(4, 4)
  plot.savefig('plot_ESl_vs_ro.png', bbox_inches='tight')
  plot.gcf().clear()
  
  ## ET
  plot.errorbar(ro_l, RLScher_ET_l, yerr=RLScher_ET_err_l, label='RL', c=NICE_ORANGE, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  plot.errorbar(ro_l, Schera0_ET_l, yerr=Schera0_ET_err_l, label='None', c=NICE_BLUE, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  plot.errorbar(ro_l, Schera3_ET_l, yerr=Schera3_ET_err_l, label='All', c=NICE_RED, marker=next(marker_c), linestyle=':', mew=0.5, ms=8)
  
  prettify(plot.gca() )
  plot.legend(framealpha=0.5, loc='best', numpoints=1)
  plot.xticks(rotation=70)
  plot.xlabel(r'Offered load $\rho$', fontsize=fontsize)
  plot.ylabel('Average job completion time', fontsize=fontsize)
  plot.gcf().set_size_inches(4, 4)
  plot.savefig('plot_ET_vs_ro.png', bbox_inches='tight')
  plot.gcf().clear()
  
  log(INFO, "done.")
  
